import React from 'react';
import store from '../../redux/store';

export default function Welcome() {
    return (
        <div>
            <div class="welcome">
                <div class="welcome__text">
                    <div class="welcome__title">SHOP</div>
                    <div class="welcome__desc">Покупай и становись лучше и привелекательней!</div>
                </div>
                <img src="http://localhost:9999/assets/shop.svg" alt=""/>
            </div>

            <div class="bottom">
                <img src="http://localhost:9999/assets/bottom.svg" alt=""/>
            </div>
            <button onClick={() => store.dispatch({
                type: 'INCREMENT'
            })} >Привет</button>
        </div>
    )
};
